import React from 'react';
import { Link } from 'react-router-dom';
import ProductCard from './ProductCard';
import './ProductListing.css';
import { LeadAcidBattery } from './images/LeadAcidBattery';

const ProductListing = () => {
 const products = [
  {
    id: 1,
    name: '12v Sealed Lead Acid Battery',
    image: LeadAcidBattery,
    price: 49.99
   },
   {
    id: 2,
    name: '24v Deep Cycle Battery',
    image: 'https://example.com/24v-battery.jpg',
    price: 69.99
   },
   {
    id: 3,
    name: '60Ah 12v Battery',
    image: 'https://example.com/60ah-battery.jpg',
    price: 54.99
   },
   {
    id: 4,
    name: '120Ah 24v Battery',
    image: 'https://example.com/120ah-battery.jpg',
    price: 99.99
   },
   {
    id: 5,
    name: '50Ah 12v Battery',
    image: 'https://example.com/50ah-battery.jpg',
    price: 42.99
   },
   {
    id: 6,
    name: '100Ah 24v Battery',
    image: 'https://example.com/100ah-battery.jpg',
    price: 79.99
   },
 ];

 return (
    <div className="product-listing">
      {products.map((product) => (
        <Link key={product.id} to={`/product/${product.id}`}>
          <ProductCard product={product} />
        </Link>
      ))}
    </div>
 );
};

export default ProductListing;
